import styled from 'styled-components';

export const About = styled.div`

`;

export const Header = styled.section`
    color:white;
    position: sticky;
    background: #f83d23;
    top: 70px;
    display: grid;
    justify-content: center;
    align-items: center;
    color: #fff;
    z-index: 5;
    margin: 0 auto;

    h1 {
        text-transform: uppercase;
        display: block;
    }
`;

export const Body = styled.section`
    background-color: white;
    position: relative;
    height: 1900px;
    z-index: 10;
`;
